const genreNames = Object.keys(favSongs);

export default function App() {
  const [songsList, setSongsList] = useState(favSongs.Pop);

  function genreClickHandler(genre) {
    var songs = favSongs[genre];
    setSongsList(songs);
  }

  function getSongsPost(songs) {
    var name = songs.Name;
    var imageUrl = songs.Image;
    var date = songs.Date;
    var desc = songs.Description;
    var rating = songs.Rating;
    var songsList = (
      <li>
        <img alt="song pic" src={imageUrl} />
        <div>
          <h3>{name}</h3>
          <small>{date}</small>
          <p>{desc}</p>
          <p>{rating}</p>
        </div>
      </li>
    );
    return songsList;
  }
  return (
    <div className="App">
      <h1>My Favourite songs</h1>
      <p id="sub-head">
        Checkout my favorite songs. Select a genre to get started
      </p>
      <div>
        {genreNames.map((genre) => {
          return (
            <button key={genre} onClick={() => genreClickHandler(genre)}>
              {genre}
            </button>
          );
        })}
      </div>
      <hr />
      <ul>
        {songsList.map((songs) => {
          return getSongsPost(songs);
        })}
      </ul>
    </div>
  );
}
